import React from 'react'
interface BottonNextProps {
    onNextPage: () => void;
}
export const BottonNext: React.FC<BottonNextProps> = ({ onNextPage }) => {
    return (
        <div className='BottonNext'>
            <button
                onClick={onNextPage}
                style={{
                    padding: "0.9em", border: "none"
                    , minWidth: "8rem", fontWeight: "bold",
                    cursor: "pointer"
                }}
            >Next
            </button>
        </div>
    )
}
